const basic={
    display: 'flex',
   justifyContent:'left',
  
};
const List = (props)=>
{
    
 return (<>
 <div className="todo_style">
 <h3 style={{padding:'20px',display:'flex'}}><i class="bi bi-trash-fill"  onClick={() =>{props.onSelect(props.id);}}></i></h3>
 
 <h5><li style={{padding:'10px',display:'flex',flexDirection:'row',justifyContent:'left'}}>{props.text}</li></h5>
 </div>
 </>);
};
export default List;
